'use strict'

function substrCount(n, s) {
  if (!s) return 0;
  let counter = 0;
  let sequence = s[0];
  let middleIndex = 0;

  for (let i = 1; i < n; i++) {
    sequence += s[i];
    
    if (middleIndex == 0 && s[i] == sequence[0]) {
      // if all same letters
      counter += sequence.length - 1;
      // console.log(sequence);
    } else if (middleIndex == 0) {
      // if first different letter
      middleIndex = sequence.length - 1;
    } else if (s[i] == sequence[middleIndex - (sequence.length - 1 - middleIndex)]) {
      // if one different letter in the middle
      counter += sequence.length - middleIndex - 1;
      // console.log(sequence);
      if (middleIndex - (sequence.length - 1 - middleIndex) == 0) {
        // if longest sequence with a different letter in the middle
        sequence = sequence.slice(middleIndex);
        if (sequence.length > 2 && sequence[0] != sequence[sequence.length - 1]) {
          sequence = sequence.slice(1);
          middleIndex = 0;
        }
      }
    } else {
      // otherwise
      sequence = sequence.slice(middleIndex);
      middleIndex = s[i] == sequence[sequence.length - 2] ? 0 : 1;
      // if the remaining sequence contains the same letters
      if (middleIndex == 0 || sequence.length == 3) {
        counter++;
        // console.log(sequence);
      }
      if (sequence.length == 3) {
        sequence = sequence[2];
        middleIndex = 0;
      }
    }
  }
  return counter + n;
}

